The Aztec 2.0 system relies on two types of hashes: Pedersen Hashes (for collision resistance) Blake2 Hashes (for pseudorandomness) Aztec relies overwhelmingly on Pedersen Hashes; as most of the time collision resistance is sufficient. Pedersen Hashes Let G be an additive group of prime order p. In its classical setting a pedersen hash is defined as a map H:F×F⟶G as follows: H(m1​,m2​)=m1​.g+m2​.h, for generators g,h∈G chosen independently by public randomness (e.g. hueristically as distinct outputs of a random oracle simulating hash function). We wish to define a variant of Pedersen to enable hashing strings of any desired length. As our group G we will use the Grumpkin curve group described above. We generate a sequence of generators h0​,...hk​ as hash outputs -- these are network parameters, fixed for the life of the protocol. They are simply chosen to be the first Keccak-256 outputs that correspond to group elements. See the derive_generators method in the barretenberg code and the Global Constants section below for exact details. Hashing field elements Our basic component for hashing will be the hash_single method. Given a field element a∈Fr​ and hash index i, we essentially hash 252 bits of a with h2i​ and the the remaining 2 bits of a with h2i+1​. This is not precisely the case, as we use a wnaf representation - see page 4 here . See the comments above hash_single in the code for exact details. The point is that while enforcing the wnaf representation to represent an integer smaller than r, this is a collision resistant function from Fr​ under DL, even when outputting only the x-coordinate. Now, given a vector a1​,…,at​∈Fr​ we define the pedersen hash as H(a_1,\ldots,a_t)=\sum_{i=1}^t \text{hash_single}(a_i,i).x Hashing byte arrays: Given a message M of arbitrary size, we first divide it up into 31-byte chunks M=M0​M2​...Mk​; in other words: M=i=0∑k​Mi​.231⋅i. We now identify each Mi​ with a field element ai​∈Fr​ in the natural way. and now we define H(M)≜H(a1​,…,at​) For details on how hi​ have been generated, please see Global Constants . Blake2s Hash We use the Blake2s Hash more sparingly, because it is not SNARK-friendly, but it does exhibit psuedorandomness not offered by Pedersen. That is, it is considered a reasonable hueristic to use it in place of a random oracle used for a security proof. We employ the standard implementation of the Blake2s hash, which is fully documented here . The Blake2s hash is utilized for computing nullifiers and for generating pseudorandom challenges, when verifying Schnorr signatures and when recursively verifying Plonk proofs. Pedersen Hash 'h' Elements There are additionally {hi​}⊂G1​ elliptic curve group points used in the computation of Pedersen hashes. For example: hi​,i>0: used to compute hashes for large data strings with inputs of size >31 bytes h0​,h1​,h2​,h3​ are used for all Pedersen Hashes in the Note Tree and Nullifier Tree The generator algorithm for computing the hi​ in pseudocode is: counter = 0
h = [] do { compute x = keccak256(pad(i)), pad(i) = 32-byte pad of i find y = sqrt (x³ + ax + b)) if y = error { \\ unsuccessful: point does not exist (50% chance) } else { \\ successful: point exists and add to list (50% chance) set h[counter] = (x, y) } counter = counter + 1 }
while counter < 1024

